import React from "react";
import NextLink from "next/link";
import { Box, Flex } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<{}> = () => {
  return (
    <Box
      p={"absolute"}
      w={"100vw"}
      h={"80px"}
      backgroundColor={"#333"}
      display={"flex"}
    >
      <Box>
        {/* <InnerBar> */}
        <NextLink href="/">
          <Box style={{ cursor: "pointer", color: "#fff" }}>Box</Box>
        </NextLink>
        <Box>
          <Box style={{ color: "#fff" }}>
            <NextLink href="/catagories">CATAGORIES</NextLink>
          </Box>
          <Box style={{ color: "#fff" }}>
            <NextLink href="/Box">ABOUT</NextLink>
          </Box>
          <Box>
            <input
              placeholder="🔍"
              style={{
                width: "7vw",
                textIndent: "5px",
                height: "30px",
                fontSize: "15px",
              }}
            ></input>
          </Box>
        </Box>
        {/* </InnerBar> */}
      </Box>
    </Box>
  );
};

export default NavBar;
